var easy2go = {responseMsg:{}};
/**
 * ahming notes: callback系一个对象,支持四个回调:
 *
 * http://segmentfault.com/a/1190000000372018
 *     callback: {     // 设置回调函数
        onShow: function() {},
        afterShow: function() {},
        onClose: function() {},
        afterClose: function() {}
    },
 *
 * 例子见： /ylcyManage/WebRoot/WEB-INF/views/vip/vip_add.jsp 搜索 onClose
 * /ylcyManage/WebRoot/WEB-INF/views/orders/orderinfo.jsp onClose等
*@type noti,info,success,warn,err
*/
easy2go.toast = function(type, msg, isKiller, timeout, callback){
    var timeout;
    if(timeout != null){
    	timeout = timeout;
    } else {
    	timeout = 2500;
    }
    var killer = isKiller || false;
    if(type == 'info')
        type = 'information';
    else if(type == 'warn')
        type = 'warning';
    else if(type == 'noti')
        type = 'notification';

    if(type=='err'){
        type='error';
        //timeout = 5000; // what for?
    }

    if(callback == null){
    	callback = {};
    }

    if(!msg)
        msg="未知...";
    noty({
        text        : msg,
        type        : type,
        dismissQueue: true,
        layout      : 'topCenter',
        timeout     : timeout,
        closeWith   :  ['click','backdrop'],
        theme       : 'relax',
        killer      : killer,
        maxVisible  : 5,
        callback	: callback,
        animation   : {
            open  : {height: 'toggle'}, //'animated bounceInUp',
            close : {height: 'toggle'}, //'animated bounceOutUp',
            easing: 'swing',
            speed : 500
        }
    });
};

easy2go.showResponseMSG = function(){
  if(easy2go.responseMsg != {}){

  	if(easy2go.responseMsg.info !==""){
  		easy2go.responseMsg.msgType = "info";
  		easy2go.responseMsg.content = easy2go.responseMsg.info;
  	}
  	if(easy2go.responseMsg.warn !==""){
  		easy2go.responseMsg.msgType = "warn";
  		easy2go.responseMsg.content = easy2go.responseMsg.warn;
  	}

  	if(easy2go.responseMsg.error !==""){
  		easy2go.responseMsg.msgType = "error";
  		easy2go.responseMsg.content = easy2go.responseMsg.error ;
      }
  	if(easy2go.responseMsg.msgType){
  		easy2go.toast(easy2go.responseMsg.msgType,
  		easy2go.responseMsg.content);
  	}
  	easy2go.responseMsg = {};
  }
};

